import React from "react";
import './Landing.css';

function Landing(props) {
  return (
    <div className="Landing">
      <h2>Bailey McIntosh is an aspring UI/UX designer.</h2>
      <img src={require('./images/creativeHeadshot.jpg')} alt="me"></img>
    </div>
  )
}

export default Landing;
